import React, { PureComponent } from 'react';
import {
  PieChart, Pie, Sector, Cell,Tooltip,ResponsiveContainer
} from 'recharts';

const data = [
  { name: 'Group A', value: 400 }, { name: 'Group B', value: 300 },
  { name: 'Group C', value: 300 }, { name: 'Group D', value: 200 },
  { name: 'Group E', value: 278 }, { name: 'Group F', value: 189 },
];
const data1 = [
  { name: 'Group A', value: 400 }, { name: 'Group B', value: 300 },
  { name: 'Group C', value: 300 }, { name: 'Group D', value: 200 },
  { name: 'Group E', value: 278 }, { name: 'Group F', value: 189 },
];
export default class Example extends PureComponent {
  static jsfiddleUrl = 'https://jsfiddle.net/alidingling/pb1jwdt1/';

  render() {
    return (
      <div>
        <div className="row" >
          <div className="column">
          <div style={{ width: '100%', height: 300, overflow: "hidden"}}>

            <PieChart width={400} height={400}>
              <Pie dataKey="value" startAngle={180} endAngle={0} data={data} cx={200} cy={200} outerRadius={80} fill="#8884d8" label />
              <Tooltip />
            </PieChart>

            </div>
          </div>
          <div className="column">
          <div style={{ width: '100%', height: 300 }}>

            <PieChart width={400} height={400}>
              <Pie dataKey="value" startAngle={180} endAngle={0} data={data1} cx={200} cy={200} outerRadius={80} fill="#8884d8" label />
              <Tooltip />
            </PieChart>

          </div>
          </div>
        </div>
      </div>



    );
  }
}
